import styled from 'styled-components';
import { SocialIcon } from 'react-social-icons';

const MarqueeImage = styled.img`

  @media(min-width: 1024px) {
    height: 400px;
    overflow: hidden;
    width: 100%;
  }
`;

export {
  MarqueeImage
};
